import React, { Component } from 'react'
export default class App extends Component {
  constructor(){
    super()
    this.state={message:'bienvenue visiteur',btn:'inscription'}
    this.message='bonjour';
  }
  inscri(){
    this.setState({message:'votre inscription valid',btn:'merci'})
    this.message='salut';
  }
  render() {
    return (
     <div>
      <h2>{this.message}</h2>
      <h2>{this.state.message}</h2>
      <button  onClick={()=>this.inscri()}>oki</button>
     </div>
    )
  }
}
